import React, { useState } from "react"


export const Login = () => {
    const [email, setEmail] = useState('');
    const [pass, setPass] = useState ('');

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log(email);
    }

    return (
        <form onSubmit = {handleSubmit}>
            <label for = "email">email</label>
            <input  value = {email}  onChange = {(e) => setEmail(e.target.value)} type = "email" placeholder = "youremail@purdue.edu"  id = "email" name = "email" />
            <label for = "password">password</label>
            <input value = {pass} onChange = {(e) => setPass(e.target.value)} type = "password" placeholder = "number"  id = "password" name = "password" />
            <button type = "submit">Log In</button>
        </form>
    )
}
